INSERT INTO `email_templates` (`id`, `title`, `slug`, `subject`, `tokens`, `description`, `created_at`, `updated_at`) VALUES
(1, 'Send welcome mail when customer signup', 'send-welcome-mail-when-customer-signup', 'Welcome to {SITE}!', '<ul>\n<li>{FULL_NAME}: User full name</li>\n<li>{EMAIL}: User Email</li>\n<li>{SITE}: Website name</li>\n</ul>', '<div align=\"left\">\r\n<b>Welcome! We’re glad you’re here!</b>\r\n</div>\r\n<div align=\"left\"><b><br></b></div>\r\n<div align=\"left\">Thank you for joining the movement. Blinkers is revolutionizing the way customers find local services and products. Use Blinkers to filter, search, browse reviews, chat, follow, favorite and connect with local busineses like never before!</div><div align=\"left\"><br>You otp is {OTP}</div>', '2019-10-30 00:00:00', '2019-10-29 00:00:00'),
(2, 'Send mail when customer forgot password', 'send-mail-when-customer-forgot-password', 'Reset Password Link {SITE}!', '<ul>\n<li>{FULL_NAME}: User full name</li>\n<li>{EMAIL}: User Email</li>\n<li>{SITE}: Website name</li>\n<li>{LINK}: Link</li>\n\n</ul>', '<p>Hello {FULL_NAME} ,</p>\r\n\r\n<p>You recently requested to reset your account password. Please use otp to reset it.</p>\r\n\r\n<p>{LINK} </p>\r\n\r\n&nbsp;If you did not request to reset your password, please ignore this email or contact to us.</p>\r\n\r\n<p>Regards</p>\r\n\r\n<p>{SITE}</p>\r\n', '2019-10-30 00:00:00', '2019-10-29 00:00:00'),
(3, 'Send mail when admin forgot password', 'send-mail-when-admin-forgot-password', 'Reset Password Link {SITE}!', '<ul>\r\n<li>{FULL_NAME}: User full name</li>\r\n<li>{EMAIL}: User Email</li>\r\n<li>{SITE}: Website name</li>\r\n<li>{LINK}: Link</li>\r\n\r\n</ul>', '<p>Hello {FULL_NAME} ,</p>\r\n\r\n<p>You recently requested to reset your account password. Click the button link below to reset it.</p>\r\n\r\n<p><a href=\"{LINK}\" target=\"_blank\">Click Here</a></p>\r\n\r\n<p>If the above link doesn\\&#39;t work for you, try copy-and-pasting the following url into your web browser&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;{LINK} &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;<br />\r\n&nbsp;If you did not request to reset your password, please ignore this email or contact to us.</p>\r\n\r\n<p>Regards</p>\r\n\r\n<p>{SITE}</p>\r\n', '2019-10-30 00:00:00', '2019-10-29 00:00:00'),
