(5, 'Send mail when driver signup', 'send-welcome-mail-when-driver-signup', 'Welcome to {SITE}!', '<ul>\r\n<li>{FULL_NAME}: User full name</li>\r\n<li>{EMAIL}: User Email</li>\r\n<li>{SITE}: Website name</li>\r\n</ul>', '<p><strong>Welcome! We&rsquo;re glad you&rsquo;re here!</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thank you for joining the movement. Local Tips is revolutionizing the way customers find local services and products. Use Local Tips to filter, search, browse reviews, chat, follow, favorite and connect with local busineses like never before!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>As new Local Tips customer you get all the benefits!<br />\r\n&nbsp;&nbsp;&nbsp; 1. Browse/Filter or Search local products and services easily<br />\r\n&nbsp;&nbsp;&nbsp; 2. Find price, full description, phone number, website and location.<br />\r\n&nbsp;&nbsp;&nbsp; 3. Chat with local businesses direct.<br />\r\n&nbsp;&nbsp;&nbsp; 4. Make purchases through the app.<br />\r\n&nbsp;&nbsp;&nbsp; 5. Track your orders.<br />\r\n&nbsp;&nbsp;&nbsp; 6. Leave amazing ratings and reviews.<br />\r\n&nbsp;&nbsp;&nbsp; 7. Follow the local businesses you love.<br />\r\n&nbsp;&nbsp;&nbsp; 8. Favorite products and services specifically.<br />\r\n&nbsp;&nbsp;&nbsp; 9. Share with friends.<br />\r\n&nbsp;&nbsp;&nbsp; 10. Local businesses send alerts so you never miss out!<br />\r\n<br />\r\nIf you have any questions at all, simply respond to this email to get in touch with our support team.<br />\r\n<a href=\"{ACTIVATION_LINK}\">Click here</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>The Local Tips Team</p>', '2019-10-30 00:00:00', '2019-11-08 13:30:33'),
(6, 'Send mail when driver forgot password', 'send-mail-when-driver-forgot-password', 'Reset Password Link {SITE}!', '<ul>\r\n<li>{FULL_NAME}: User full name</li>\r\n<li>{EMAIL}: User Email</li>\r\n<li>{SITE}: Website name</li>\r\n<li>{LINK}: Link</li>\r\n\r\n</ul>', '<p>Hello {FULL_NAME} ,</p>\r\n\r\n<p>You recently requested to reset your account password. Click the button link below to reset it.</p>\r\n\r\n<p><a href=\"{LINK}\" target=\"_blank\">Click Here</a></p>\r\n\r\n<p>If the above link doesn\\&#39;t work for you, try copy-and-pasting the following url into your web browser&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;{LINK} &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;<br />\r\n&nbsp;If you did not request to reset your password, please ignore this email or contact to us.</p>\r\n\r\n<p>Regards</p>\r\n\r\n<p>{SITE}</p>\r\n', '2019-10-30 00:00:00', '2019-10-29 00:00:00');

